					speech[] = {"\a3\dubbing_f_epa\a_hub\040_a_m03_briefing\a_hub_040_a_m03_briefing_MIL_7.ogg"};
					text = "Charlie will set up a mortar. Alpha will provide overwatch and mark priority targets.";
