					speech[] = {"\a3\dubbing_f_epa\a_hub\140_welcome_a_hub02\a_hub_140_welcome_a_hub02_DEL_8.ogg"};
					text = "And you, Corporal Kerry, you seem to developed the habit of staying alive.";
					variant = "";
					variantText = "";
					class Arguments {};
